import { FullScreenContainer } from "../common/loginsignupstyles"
import {AppDiv,CardOuterDiv,CenterAppbar,StyledImage,StyledLink} from "./Dashboard.styles"

import photo from "../../assets/logos/Logo_with_text.svg"

export const Dashboard = () => {
    return (
      <FullScreenContainer>
        <AppDiv>
            <StyledImage src={photo}></StyledImage>
          <CenterAppbar>
            
          </CenterAppbar>
          <div>
            <StyledLink to="/login"> Login</StyledLink>
            
            <StyledLink to="/signup"> Signup</StyledLink>
            
            {/* here i will add the functionality of sign out */}
          </div>
          
        </AppDiv>

        <CardOuterDiv></CardOuterDiv>
      </FullScreenContainer>
    );
  };
